import React, { useState, useEffect } from "react";
import Iframe from "react-iframe";

export default function Videos({ videos }) {
  return (
    <div>
      {videos &&
        videos.map((v) => {
          return <Iframe width="300" url={v.uri}></Iframe>;
        })}
    </div>
  );
}
